import React from "react";
import "./App.css";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <div>
        <h1>My Name Is Abdul Hay</h1>
        <p>
          Lorem, ipsum dolor sit amet consectetur adipisicing elit. Doloribus
          facere, ab perspiciatis ducimus eius odit voluptatibus magni unde
          excepturi! Minus libero quod blanditiis accusantium ex.
        </p>
      </div>
      <div>
        <h3>Skills</h3>
        <ul>
          <li>JavaScript</li>
          <li>WordPress</li>
          <li>ReactJs</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
